import React from 'react';
import Sdata from './Sdata';
import Cards from './Card';


const State = ()=>{
    let Series = 'netFlix';
    if(Series === 'netFliX'){
        return (
            <>
            <Cards key={Sdata[0].id}
                imgsrc={Sdata[0].imgsrc}
                title={Sdata[0].title}
                sname={Sdata[0].sname}
                link={Sdata[0].link} />


                <Cards key={Sdata[1].id}
                imgsrc={Sdata[1].imgsrc}
                title={Sdata[1].title}
                sname={Sdata[1].sname}
                link={Sdata[1].link} />
            </>
        )
    }else{
        <Cards key={Sdata[2].id}
        imgsrc={Sdata[2].imgsrc}
        title={Sdata[2].title}
        sname={Sdata[2].sname}
        link={Sdata[2].link} />
    }
}

const App = ()=>{
    return(
    <>  <h1 className="heading_style">LIST OF TOP 5 NETFLIX SERIES IN 2021</h1>
<div className="flexBox">

 <State />

    
</div>
</>
    )
}

export default App;
